(()=>{"use strict";!function(){const t=document.getElementById("grid");for(let s=0;s<8;s++)for(let s=0;s<8;s++)t.innerHTML+="<div class='bg-white border-2 border-slate-950 gap-2'></div>"}();class t{constructor(t,s){this.row=t,this.col=s,this.adjList=[]}}new class{constructor(t=[],s=[]){this.board=this.buildBoard(),this.start=t,this.end=s}buildBoard(){const s=[];for(let e=0;e<8;e++){s.push([]);for(let r=0;r<8;r++)s[e][r]=new t(e,r)}return s}possibleMoves(t,s){return[[-2,1],[-1,2],[1,2],[2,1],[2,-1],[1,-2],[1,-2],[-1,-2]]}createAdjList(){for(let t=0;t<8;t++)for(let s=0;s<8;s++)this.possibleMoves(t,s)}}})();